import Vue from 'vue'
import VueRouter from 'vue-router'
Vue.use(VueRouter);
// 引人组件
import Home from '@/views/Home';
import Test from '@/views/Test';
import Login from '@/views/Login';
import Detail from '@/views/Detail';

const router = new VueRouter({
    mode:'history',
    routes:[
        {
            path:'/home',
            component:Home
        },
        {
            path:'/test',
            component:Test
        },
        {
            path:'/login',
            component:Login
        },
        {
            path:'/detail',
            component:Detail
        },
        {
            path:'/',
            component:Home
        }
    ]
})

export default router
